import PopUp from '../components/PopUp';
import {connect} from 'react-redux';
function mapReduxStateToReactProps(dispatch){
    return {
        onClickPopUp:function(e){
            dispatch({type:'POPUP', })
        }
    }
}
export default connect(mapReduxStateToReactProps)(PopUp);
